function ProduceItem(props) {
    const { item } = props;
    return (
        <>
        <div className="produce__item">
                    <img src={item.image} alt={item.name} />
                    <h2>{item.name}</h2>
                    <p>${item.price} / lb</p>
                    <button>Add to Cart</button>
                    </div> 
        
        </>
    )
}
export default ProduceItem;
